/**
 * MFP.Server.invokeHttp(parameters) accepts the following json object as an
 * argument: { // Mandatory method : 'get' , 'post', 'delete' , 'put' or 'head'
 * path: value, // Optional returnedContentType: any known mime-type or one of
 * "json", "css", "csv", "javascript", "plain", "xml", "html"
 * returnedContentEncoding : 'encoding', parameters: {name1: value1, ... },
 * headers: {name1: value1, ... }, cookies: {name1: value1, ... }, body: {
 * contentType: 'text/xml; charset=utf-8' or similar value, content: stringValue },
 * transformation: { type: 'default', or 'xslFile', xslFile: fileName } }
 */

/**
 * @param interest
 *            must be one of the following: world, africa, sport, technology,
 *            ... (The list can be found in
 *            http://edition.cnn.com/services/rss/)
 * @returns json list of items
 */
function getBuildingDemolitionApplications(tradeLicenseNo, applicationStartDate, applicationEndDate) {
	try {
		tradeLicenseNo = (MFP.Server.getAuthenticatedUser('masterAuthRealm') != undefined && MFP.Server.getAuthenticatedUser != null) ? MFP.Server.getAuthenticatedUser('masterAuthRealm').corporatesAttributes.businessLicenseNo: tradeLicenseNo;
	} catch (e) {
		// TODO: handle exception
	}
	var path = "/mobiletrapermitservice";
	var getAvailableDeliveryDetailsRequest = '<soapenv:Envelope xmlns:wsse="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd" xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/" xmlns:sch="http://www.rta.ae/ActiveMatrix/ESB/schemas/MobileTRAPermitsService/SharedResources/XMLSchema/Schema.xsd">'
      + '<soapenv:Header>'
      + '<wsse:Security>'
      + '<wsse:UsernameToken>'
      + '<wsse:Username>' + user.username + '</wsse:Username>'    
      + '<wsse:Password>' + user.password + '</wsse:Password>'
      + '</wsse:UsernameToken>'
      + '</wsse:Security>'
      + '</soapenv:Header>'
      + '<soapenv:Body>'
      + '<sch:getApplicationsList>'
      + '<sch:applicationsListRequest>'
      + '<sch:tradeLicenseNo>' + tradeLicenseNo + '</sch:tradeLicenseNo>'
      + '<sch:applicationStartDate>' + applicationStartDate + '</sch:applicationStartDate>'
      + '<sch:applicationEndDate>' + applicationEndDate + '</sch:applicationEndDate>'
      + '</sch:applicationsListRequest>'
      + '</sch:getApplicationsList>'
      + '</soapenv:Body>'
      + '</soapenv:Envelope>';
	var input = {
		method : 'post',
		returnedContentType : 'xml',
		path : path,
		body : {
			content : getAvailableDeliveryDetailsRequest.toString(),
			contentType : 'text/xml; charset=utf-8'
		},
		transformation: { 
			type: 'xslFile', 
	  		xslFile: "getApplicationsList.xsl" 
	  	} 
	};
	var response = invokeTimestampedProcedure(input,'getApplicationsList');
	MFP.Logger.info(response);
	return response;
}


//function getMajorRoadsDiversions(parameters) {
function getMajorRoadsDiversions(applicationTypeID, applicationID, tradeLicenseNo, applicationStartDate, applicationEndDate) {
	try {
		tradeLicenseNo = (MFP.Server.getAuthenticatedUser('masterAuthRealm') != undefined && MFP.Server.getAuthenticatedUser('masterAuthRealm') != null) ? MFP.Server.getAuthenticatedUser('masterAuthRealm').corporatesAttributes.businessLicenseNo : tradeLicenseNo;
	} catch (e) {
		// TODO: handle exception
	}
	var path = "/mobiletrapermitservice";
	
	if(applicationTypeID != ""){
		var getApplicationsListRequest = '<soapenv:Envelope xmlns:soapenv="http://schemas.xmlsoap.org/soap/envelope/" xmlns:xs="http://www.rta.ae/ActiveMatrix/ESB/TSPSServiceSchema/XMLSchema" xmlns:xs1="http://www.rta.ae/ActiveMatrix/ESB/TSPSService/XMLSchema">\
			   <soapenv:Header>\
			 <wsse:Security soapenv:mustUnderstand="0" xmlns:wsse="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd" xmlns="http://docs.oasis-open.org/wss/2004/01/oasis-200401-wss-wssecurity-secext-1.0.xsd" xmlns:sch="http://schemas.xmlsoap.org/soap/envelope/">\
		    <wsse:UsernameToken>\
		            <wsse:Username>' + user.username + '</wsse:Username>\
		            <wsse:Password>' + user.password + '</wsse:Password>\
		         </wsse:UsernameToken>\
		      </wsse:Security>\
				</soapenv:Header>\
		   <soapenv:Body>\
		      <xs:getApplicationsList>\
		         <xs:applicationsListRequest>\
		            <xs1:applicationTypeID>'+applicationTypeID+'</xs1:applicationTypeID>\
		            <xs1:applicationID>'+applicationID+'</xs1:applicationID>\
		            <xs1:tradeLicenseNo>'+tradeLicenseNo+'</xs1:tradeLicenseNo>\
		            <xs1:applicationStartDate>'+applicationStartDate+'</xs1:applicationStartDate>\
		            <xs1:applicationEndDate>'+applicationEndDate+'</xs1:applicationEndDate>\
		         </xs:applicationsListRequest>\
		      </xs:getApplicationsList>\
		   </soapenv:Body>\
		</soapenv:Envelope>';
		var input = {
			method : 'post',
			returnedContentType : 'xml',
			path : path,
			body : {
				content : getApplicationsListRequest.toString(),
				contentType : 'text/xml; charset=utf-8'
			},
			transformation: { 
				type: 'xslFile', 
				contentType : 'application/soap+xml;charset=UTF-8',
		  		xslFile: "getApplicationsListDiversions.xsl"
		  	} 
		};
		var response = invokeTimestampedProcedure(input,'getApplicationsList');
		if (response.errors.length > 0) {
			MFP.Logger.warn("Error getting applications");
			return {
				isSuccessful : false,
				errorCode : 301,
				message : "An error has been occured in the server. Kindly try again"
			};
		}
		MFP.Logger.info(getApplicationsListRequest);
	}else{
		response = {
			isSuccessful : true,
			applications : [],
			message : "Application typeID is Required"
		};
	}
	MFP.Logger.info(response);
	return response;
}

