function checkTransactionStatus(applicationId, serviceId){
	MFP.Logger.info('Start checking transaction status');
	//return {isSuccessful : true, sptrn:transactionSPTRN};
	var transactionSPTRN = _getSPTRNFromTransactionID(applicationId, serviceId);
	
	MFP.Logger.info('Transaction SPTRN : '+ transactionSPTRN);
	//return {transactionSPTRN:transactionSPTRN};
	//return getAppPendingPaymentApplications() ;
	if(transactionSPTRN == null){
		return {
			isSuccessful : false,
			errorMessage : "Application not found in the pending applications server"
		};
	}
	
	
	return checkTransactionStatusWithSptrn(applicationId, serviceId, transactionSPTRN);
}

function checkTransactionStatusWithSptrn(applicationId, serviceId, transactionSPTRN){
	
	MFP.Logger.info("Checking EPAY Status with SPTRN : "+transactionSPTRN);
	//Checing status with EPAY
	var ePayStatus = _getEpayStatus(transactionSPTRN);
	MFP.Logger.info("ePayStatus ");
	MFP.Logger.info(ePayStatus);
	var transactionReceiptDetails = getPermitFeesAmount(applicationId);
	MFP.Logger.info("transactionReceiptDetails");
	//Getting transaction receipt details
	var feesInfo = transactionReceiptDetails.feesInfo ;
	MFP.Logger.info("Checking extra load transaction status for app id "+applicationId);
	MFP.Logger.info(feesInfo);
	MFP.Logger.info(ePayStatus);
	if(transactionReceiptDetails.feesInfo == undefined || transactionReceiptDetails.totalAmount == 0){
		return {
			status : "3"
		};
	}
	if(ePayStatus.status == '0'){ // Success
		//TODO Check the amount returned from EPAY
		
		
		var receiptDate = new Date(); 
//		WL.Server.info('Confirming transaction Id '+applicationId);
		var confirmResponse = confirmTransactionPayment(applicationId,ePayStatus.transaction.DEGTRN, _formatSTSDate(receiptDate), transactionReceiptDetails.totalAmount  );
//		MFP.Logger.info("confirmResponse   " +confirmResponse);
		if(confirmResponse.isSuccessful){
			return{
				status : "1",
				reference : confirmResponse
			};
		}else{
			return {
				isSuccessful : false,
				reference : confirmResponse
			};
		} 
	}else if(ePayStatus.status == '2'){
		//Update transaction status and make it failed
		var confirmResponse = confirmFailedPayment(applicationId,feesInfo.receiptNo, feesInfo.receiptDate, feesInfo.receiptAmount );
		if(confirmResponse.isSuccessful){
			return{
				status : "2"
			};
		}else{
			return {
				isSuccessful : false
			};
		}
	}else{
		return{
			status : "0"
		};
	}
	
}

