function _getSPTRNFromTransactionID(transactionId, serviceId){
	//return "CRP"+serviceId+"_"+transactionId ;
	
	var applications = getAppPendingPaymentApplications().applications;
	//return applications ;
	MFP.Logger.info("Checking "+applications.length+" applications :");
	MFP.Logger.info(applications);
	var SPTRN = null ;
	for(var i=0; i<applications.length; i++){
		MFP.Logger.info("Checking application "+i);
		var app = applications[i];
		var applicationID = app.applicationID ;
		if(applicationID == transactionId){
			
			SPTRN = app.spTRN ;
			break ;
		}
	}
	MFP.Logger.info("SPTRN == "+SPTRN);
	return SPTRN ;
}


